import LevelBuilderfrom sprites import *def render(name,bg):	lb = LevelBuilder.LevelBuilder(name+".plist",background=bg)	lb.addObject(Beam.BeamSprite(x=240, y=166,width=60,height=10,angle='0',restitution=0.2,static='false',friction=0.5,density=10 ).setName('Beam4'))	lb.addObject(Beam.BeamSprite(x=445, y=222,width=76,height=10,angle='0',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam7'))	lb.addObject(Beam.BeamSprite(x=35, y=221,width=76,height=10,angle='0',restitution=0.2,static='true',friction=0.5,density=20 ).setName('Beam1'))	lb.addObject(Beam.BeamSprite(x=166, y=176,width=60,height=10,angle='-15',restitution=0.2,static='false',friction=0.5,density=10 ).setName('Beam3'))	lb.addObject(Beam.BeamSprite(x=105, y=202,width=60,height=10,angle='-30',restitution=0.2,static='false',friction=0.5,density=10 ).setName('Beam2'))	lb.addObject(Beam.BeamSprite(x=309, y=176,width=60,height=10,angle='15',restitution=0.2,static='false',friction=0.5,density=10 ).setName('Beam5'))	lb.addObject(Beam.BeamSprite(x=374, y=203,width=60,height=10,angle='30',restitution=0.2,static='false',friction=0.5,density=10 ).setName('Beam6'))	lb.addObject(Hero.HeroSprite(x=28, y=243,width=32,height=32))	lb.addObject(Joints.DistanceJoint(body1='Beam1',body2='Beam2',damping='0.2',freq='5' , b1_Xoffset = '30' , b2_Xoffset = '-30' ))	lb.addObject(Joints.DistanceJoint(body1='Beam2',body2='Beam3',damping='0.2',freq='5' , b1_Xoffset = '30' , b2_Xoffset = '-30' ))	lb.render()